import React from 'react'
import {Container} from 'react-bootstrap'

const DonationScreen = () => {
    return (
        <div>
            <Container>
                <h2 className="text-center py-3"><strong>Our Club is not able to run for free.</strong></h2>
                <p>Some expenses that are necessary for our club's success and mission of providing students with an easy to learn environment</p>
            </Container>
        </div>
    )
}

export default DonationScreen
